import { Injectable } from "@angular/core";
import * as FileSaver from "file-saver";
@Injectable()
export class ExportFileService{
    exportPdf(exportColumns:any,data:any,fileName:string) {
        import('jspdf').then((jsPDF) => {
            import('jspdf-autotable').then((x) => {
                const doc = new jsPDF.default('landscape', 'px', 'a4');
                doc.addFileToVFS('Times New Romance-normal.ttf', font);
                doc.addFont('Times New Romance-normal.ttf', 'Times New Romance', 'normal');
                doc.setFont('Times New Romance');
                (doc as any).autoTable(exportColumns, data);
                doc.save(`${fileName}.pdf`);
            });
        });
    }

    exportExcel(data:any,fileName:string) {
        import('xlsx').then((xlsx) => {
            const worksheet = xlsx.utils.json_to_sheet(data);
            const workbook = { Sheets: { data: worksheet }, SheetNames: ['data'] };
            const excelBuffer: any = xlsx.write(workbook, { bookType: 'xlsx', type: 'array' });
            this.saveAsExcelFile(excelBuffer, fileName);
        });
    }

    private saveAsExcelFile(buffer: any, fileName: string): void {
        let EXCEL_TYPE = 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;charset=UTF-8';
        let EXCEL_EXTENSION = '.xlsx';
        const data: Blob = new Blob([buffer], {
            type: EXCEL_TYPE
        });
        FileSaver.saveAs(data, fileName + '_export_' + new Date().getTime() + EXCEL_EXTENSION);
    }
}
